import React from "react";
import img1 from "./images/logo192.png";

const Cards = () => {
    return (
        <main>
            <div className="eventCard">
                <img src={img1} alt="John" style={{ height: "50px" }} />
                <h1>Event Card </h1>
                <p className="eventTitle">Hackathon</p>
                <p>Harvard University</p>

                <p>
                    <button className="eventButton">Live Now</button>
                </p>
            </div>
        </main>
    );
};

export default Cards;
